The last few days have been some of my toughest to date since becoming a public figure. The hate has been overwhelming, but the messages from those of you that felt seen, validated, & loved far outweigh the critics. I’m responding to as many of y’all as I can, but I will be taking a little social break after this to focus on my own mental health. Just remember that having an ED isn’t shameful & you deserve respect & love regardless of where you’re at in your journey with your body. Love y’all 💕✨

If you are struggling here are some resources that may help:
@dietitiananna
@neda
@allianceforeda 
@seedsupportuk

This week on #SlumberPartyPod, I made a new BFF - @jofrost, YEA- the incredible Supernanny! (Also with a special guest: Bowie!) I’ve admired her for so long & can happily say that because of her, Bowie is now sleeping in his own bed! 🥳

It was also soooo heartwarming to hear my fellow cancer, empath angel Nanny Jo validate me about my decision to leave an abusive relationship and to share with her what my healing journey has looked like🥺

Not every parent can leave an abusive situation & I hold space for them. If you are someone you love is in a similar situation here are some resources that might help (LGBTQA inclusive as well!):
@ndvhofficial
@safehorizon
@rainn
@refugecharity
